  [],\n\t\"revision_timestamp\": \"2016-07-27T22:21:26.255277\",\n\t\"name\": \"plant-communities-of-the-pixley-national-wildlife-refuge\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"A plant community analysis was performed
  as per a request by Dr. Thomas J. Rice of Cal  Poly State University to enhance
  the detailed soil survey of Pixley National Wildlife  Refuge. The refuge is located
  approximately 19 miles south of Tulare City, in the San  u00b7 Joaquin Valley of
  California. Both the soil survey and the plant community study will be  used by
  the refuge officials to aid in management of the refuge and endangered species  such
  as the Blunt-nosed leopard lizard and the San Joaquin kit fox. Plant community  mapping
  and sampling was performed for approximately one year: September 1987 to  June,
  1988. Herbarium specimins were provided for the Robert F. Hoover and the Kern  National
  Wildlife Refuge herbariums. Three main plant communities and six  sub-communities
  were identified within the study areas. Vernal pools were found to be  greatly disturbed
  and not as abundant as was expected. Soil types and boundaries were  much more intricate
  than the plant communities, although correlations did exist.  Coarse-textured soils
  had similar species composition to the fine-textured soils but tended  to have larger
  growth forms, higher abundance and higher species diversity.\",\n\t\"license_title\":
